ial, indirect or consequential loss or damage.<br /> 11.8&nbsp;&nbsp; [You accept that we have an interest in limiting the personal liability of our officers and employees and, having regard to that interest, you acknowledge that we are a limited liability entity; you agree that you will not bring any claim personally against our officers or employees in respect of any losses you suffer in connection with the website or these terms and conditions (this will not, of course, limit or exclude the liability of the limited liability entity itself for the acts and omissions of our officers and employees).]<br /> <br /><strong>&nbsp; 6. Breaches of these terms and conditions</strong><br /><br /> 12.1&nbsp;&nbsp; Without prejudice to our other rights under these terms and conditions, if you breach these terms and conditions in any way, or if we reasonably suspect that you have breached these terms and conditions in any way, we may:<br /> (a)&nbsp;&nbsp;&nbsp;&nbsp; send you one or more formal warnings;<br /> (b)&nbsp;&nbsp;&nbsp;&nbsp; temporarily suspend your access to our website;<br /> (c)&nbsp;&nbsp;&nbsp;&nbsp; permanently prohibit you from accessing our website;<br /> (d)&nbsp;&nbsp;&nbsp;&nbsp; block computers using your IP address from accessing our website;<br /> (e)&nbsp;&nbsp;&nbsp;&nbsp; contact any or all your internet service providers and request that they block your access to our website;<br /> (f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; commence legal action against you, whether for breach of contract or otherwise; and/or<br /> 12.2&nbsp;&nbsp; Where we suspend or prohibit or block your access to our website or a part of our website, you must not take any action to circumvent such suspension or prohibition or blocking (including without limitation creating and/or using a different account).<br /> <br /><strong>&nbsp; 7. Variation</strong><br /><br /> 13.1&nbsp;&nbsp; We may revise these terms and conditions from time to time.<br /> 13.2&nbsp;&nbsp; The revised terms and conditions will apply to the use of our website from the date of their publication on the website, and you hereby waive any right you may otherwise have to be notified of, or to consent to, revisions of the terms and conditions. / We will give you written notice of any revision of these terms and conditions, and the revised terms and conditions will apply to the use of our website from the date that we give you such notice; if you do not agree to the revised terms and conditions, you must stop using our website.<br /> 13.3&nbsp;&nbsp; If you have given your express agreement to these terms and conditions, we will ask for your express agreement to any revision of these terms and conditions; and if you do not give your express agreement to the revised terms and conditions within such period as we may specify, we will disable or delete your account on the website, and you must stop using the website.<br /> <br /><strong>&nbsp; 8. Assignment</strong><br /><br /> 14.1&nbsp;&nbsp; You hereby agree that we may assign, transfer, sub-contract or otherwise deal with our rights and/or obligations under these terms and conditions.<br /> 14.2&nbsp;&nbsp; You may not without our prior written consent assign, transfer, sub-contract or otherwise deal with any of your rights and/or obligations under these terms and conditions.<br /> <br /><strong>&nbsp; 9. Severability</strong><br /><br /> 15.1&nbsp;&nbsp; If a provision of these terms and conditions is determined by any court or other competent authority to be unlawful and/or unenforceable, the other provisions will continue in effect.<br /> 15.2&nbsp;&nbsp; If any unlawful and/or unenforceable provision of these terms and conditions would be lawful or enforceable if part of it were deleted, that part will be deemed to be deleted, and the rest of the provision will continue in effect.<br /> <br /><strong>&nbsp; 10. Third party rights</strong><br /><br /> 16.1&nbsp;&nbsp; These terms and conditions are for our benefit and your benefit, and are not intended to benefit or be enforceable by any third party.<br /> 16.2&nbsp;&nbsp; The exercise of the parties'' rights under these terms and conditions is not subject to the consent of any third party.<br /> <br /><strong>&nbsp; 11. Entire agreement</strong><br /><br /> 17.1&nbsp;&nbsp; Subject to Section 11.1, these terms and conditions, together with [our privacy and cookies policy], constitute the entire agreement between you and us in relation to your use of our website and supersede all previous agreements between you and us in relation to your use of our website.<br /> <br /><strong>&nbsp; 12. Law and jurisdiction</strong><br /><br /> 18.1&nbsp;&nbsp; These terms and conditions shall be governed by and construed in accordance with English law.<br /> 18.2&nbsp;&nbsp; Any disputes relating to these terms and conditions shall be subject to the exclusive / non-exclusive jurisdiction of the courts of England.<br /> <br /><strong>&nbsp; 13. Statutory and regulatory disclosures</strong><br /><br /> 19.1&nbsp;&nbsp; [We are registered in England and Wales; you can find the online version of the register at [ http://wck2.companieshouse.gov.uk//compdetails ], and our registration number is 08482912.<br /> 19.2&nbsp;&nbsp; [We are subject to [<em>authorisation scheme</em>], which is supervised by [<em>supervisory authority</em>].]<br /> 19.3&nbsp;&nbsp; [We are registered as [<em>title</em>] with [<em>professional body</em>] in [<em>the United Kingdom</em>] and are subject to [<em>rules</em>], which can be found at [<em>URL</em>].]<br /> 19.4&nbsp;&nbsp; [We subscribe to [<em>code(s) of conduct</em>], which can be consulted electronically at [<em>URL(s)</em>].]<br /> 19.5&nbsp;&nbsp; [Our VAT number is [<em>number</em>].]<br /> <br /><strong>&nbsp;14. Our details</strong><br /><br /> 20.1&nbsp;&nbsp; This website is owned and operated by Five Sessions Ltd.<br /> 20.2&nbsp;&nbsp; We are registered in England and Wales under registration number 08482912, and our registered office is at 3<sup>rd</sup> Floor, 207 Regent Street, London, W1B 3HH, United Kingdom.<br /> 20.3 &nbsp; You can contact us by writing to the business address given above, by using our website contact form, by email to info@thegreekspots.co.uk.</p>', NULL, '0000-00-00 00:00:00'),
(83, NULL, NULL, NULL, 'copywrite', 1, 'page', 0, 1, NULL, 'large-12', NULL, NULL, 'html', '<p>Copyright &copy; 2014 Five Sessions Ltd</p>\r\n<p><strong>&nbsp;1. &nbsp;&nbsp;&nbsp; Ownership of copyright</strong></p>\r\n<p>We own the copyright in:</p>\r\n<p>(a)&nbsp;&nbsp;&nbsp;&nbsp; this website; and</p>\r\n<p>(b)&nbsp;&nbsp;&nbsp;&nbsp; the material on this website (including, without limitation, the text, computer code, artwork, photographs, images, music, audio material, video material and audio-visual material on this website).</p>\r\n<p><strong>&nbsp;2. &nbsp;&nbsp;&nbsp; Copyright licence</strong></p>\r\n<p>We grant to you a worldwide, non-exclusive, royalty-free, revocable licence to:</p>\r\n<p>(a)&nbsp;&nbsp;&nbsp;&nbsp; view this website and the material on this website on a computer or mobile device via a web browser;</p>\r\n<p>(b)&nbsp;&nbsp;&nbsp;&nbsp; copy and store this website and the material on this website in your web browser cache memory; and</p>\r\n<p>(c)&nbsp;&nbsp;&nbsp;&nbsp; print pages from this website for your own [personal and non-commercial] use.</p>\r\n<p>We do not grant you any other rights in relation to this website or the material on this website. In other words, all other rights are reserved.</p>\r\n<p>For the avoidance of doubt, you must not adapt, edit, change, transform, publish, republish, distribute, redistribute, broadcast, rebroadcast, or show or play in public this website or the material on this website (in any form or media) without our prior written permission.&nbsp;&nbsp;</p>\r\n<p><strong>&nbsp;3. &nbsp;&nbsp;&nbsp; Data mining</strong></p>\r\n<p>The automated and/or systematic collection of data from this website is prohibited.</p>\r\n<p><strong>&nbsp;4. &nbsp;&nbsp;&nbsp; Permissions</strong></p>\r\n<p>You may request permission to use the copyright materials on this website by writing to info@thegreekspots.co.uk or 3<sup>rd</sup> Floor, 207 Regent Street, London, W1B 3HH.</p>\r\n<p><strong>&nbsp;5. &nbsp;&nbsp;&nbsp; Enforcement of copyright</strong></p>\r\n<p>We take the protection of our copyright very seriously.</p>\r\n<p>If we discover that you have used our copyright materials in contravention of the licence above, we may bring legal proceedings against you, seeking monetary damages and/or an injunction to stop you using those materials. You could also be ordered to pay legal costs.</p>\r\n<p>If you become aware of any use of our copyright materials that contravenes or may contravene the licence above, please report this by email to info@thegreekspots.co.uk or by post to 3<sup>rd</sup> Floor, 207 Regent Street, London, W1B 3HH, United Kingdom.</p>\r\n<p><strong>&nbsp;6. &nbsp;&nbsp;&nbsp; Infringing material</strong></p>\r\n<p>If you become aware of any material on our website that you believe infringes your or any other person''s copyright, please report this by email to info@thegreekspots.co.uk or by post to 3<sup>rd</sup> Floor, 207 Regent Street, London, W1B 3HH, United Kingdom.</p>', NULL, '0000-00-00 00:00:00'),
(84, NULL, NULL, NULL, 'about us', 1, 'page', 0, 1, NULL, 'large-12', NULL, NULL, 'html', '<p>The TGS team is made up of experienced extreme water-sporters, who love Greece for its sun, sea, wind and waves.<br /> <br /> Our aim is to promote both in Greece and abroad all the beautiful spots for surf, windsurf, kitesurf, wakeboard and waterski that Greece has to offer.<br /> <br /> We have compiled one of the most extensive lists of spots (both secret and not) with detailed information about them including weather forecasts, tips about where to stay, where to eat, and updates on all the events and contests which are organized in the country.<br /> <br /> With 2013 as a starting point, we ultimately created the most complete Internet guide, helping to support the development of extreme sports and surrounding areas.<br /> <br /> Through this guide we will introduce you to unknown spots, sharing with you the secrets of our country.</p>', NULL, '0000-00-00 00:00:00'),
