(93, NULL, NULL, NULL, 'Advertise with us', 1, 'page', 1, 1, NULL, 'large-12', NULL, NULL, 'html', '<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>BASIC MEMBERSHIP - &euro;90 (excl Vat) / YEAR</strong></li>\r\n</ul>\r\n<p>A simple offer for online contacts. You can list your email, website link, all other contact details and add a 100 character description of your business. Your business will also be listed in our downloadable surf spots guides.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>ADVANCED MEMBERSHIP - &euro;150 (excl Vat) / YEAR</strong></li>\r\n</ul>\r\n<p>This offer is enhanced with images. You can list your contact details, email, website link and add a 250 character description of your business. You can add your logo and 2 images. Your business will also be listed in our downloadable surf spots guides.</p>\r\n<p>PLUS a 120x90 MINI BANNER AD, retargeted to your area and shown on general Thegreekspots.co.uk pages with unlimited page views for 12 months.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>PREMIUM MEMBERSHIP - &euro;280 (excl Vat) / YEAR</strong></li>\r\n</ul>\r\n<p>This is an extensive offer. You can list your contact details, email, website link and add a 350 character of description of your business. You can add your logo, 10 images, 5 downloadable documents such as brochures, and sell 5 products directly from your listing, and HTML editing. Your business will also be listed in our downloadable surf spots guides.</p>\r\n<p>PLUS a 120x90 BANNER AD, retargeted to your area, and shown on general Thegreekspots.co.uk pages, with unlimited page views for 12 months.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', NULL, '0000-00-00 00:00:00'),
(94, NULL, NULL, NULL, 'Production', 1, 'page', 1, 2, NULL, 'large-12', NULL, NULL, 'html', '<p>We can photograph or film your bussines with our state of the art drone. Give your bussines a unique image with air photos/ video. Please contact us for more informations.</p>', NULL, '0000-00-00 00:00:00');
