(95, NULL, NULL, NULL, 'Privacy Policy', 1, 'page', 1, 1, NULL, 'large-12', NULL, NULL, 'html', '<p><strong>&nbsp;1. &nbsp;&nbsp;&nbsp;&nbsp; What information do we collect?</strong></p>\r\n<p>&nbsp;</p>\r\n<p>We may collect, store and use the following kinds of personal information:</p>\r\n<p>&nbsp;</p>\r\n<p>[(a)&nbsp;&nbsp;&nbsp; information about your computer and about your visits to and use of this website (including [your IP address, geographical location, browser type and version, operating system, referral source, length of visit, page views, website navigation and [<em>details</em>]]);]</p>\r\n<p>&nbsp;</p>\r\n<p>[(b)&nbsp;&nbsp;&nbsp; information relating to any transactions carried out between you and us on or in relation to this website, including information relating to any purchases you make of our goods or services (including [<em>details</em>]);]</p>\r\n<p>&nbsp;</p>\r\n<p>[(c)&nbsp;&nbsp;&nbsp; information that you provide to us for the purpose of registering with us (including [<em>details</em>]);]</p>\r\n<p>&nbsp;</p>\r\n<p>[(d)&nbsp;&nbsp;&nbsp; information that you provide to us for the purpose of subscribing to our website services, email notifications and/or newsletters (including [<em>details</em>]);]</p>\r\n<p>&nbsp;</p>\r\n<p>[(e)&nbsp;&nbsp;&nbsp; any other information that you choose to send to us; and]</p>\r\n<p>&nbsp;</p>\r\n<p>[(f)&nbsp;&nbsp;&nbsp; <em>other information</em><em>.</em>]<a href="#_ftn1" name="_ftnref1">[1]</a></p>\r\n<p>&nbsp;</p>\r\n<p>[Before you disclose to us the personal information of another person, you must obtain that person''s consent to both the disclosure and the processing of that personal information in accordance with the terms of this privacy policy.]</p>\r\n<p>&nbsp;</p>\r\n<p>[<strong>(2)&nbsp;&nbsp;&nbsp;&nbsp; Cookies</strong><a href="#_ftn2" name="_ftnref2">[2]</a></p>\r\n<p>&nbsp;</p>\r\n<p>A cookie is a file containing an identifier (a string of letters and numbers) that is sent by a web server to a web browser and is stored by the browser. The identifier is then sent back to the server each time the browser requests a page from the server. This enables the web server to identify and track the web browser.</p>\r\n<p>&nbsp;</p>\r\n<p>We [may] use [both] ["session" cookies] [and "persistent" cookies] on the website. [Session cookies will be deleted from your computer when you close your browser.] [Persistent cookies will remain stored on your computer until deleted, or until they reach a specified expiry date.]</p>\r\n<p>&nbsp;</p>\r\n<p>[We will use the session cookies to: keep track of you whilst you navigate the website; keep track of items in your shopping basket; prevent fraud and increase website security; and [<em>other uses</em>].] [We will use the persistent cookies to: enable our website to recognise you when you visit; keep track of your preferences in relation to your use of our website; and [<em>other uses</em>].]</p>\r\n<p>&nbsp;</p>\r\n<p>[We use Google Analytics to analyse the use of this website. Google Analytics generates statistical and other information about website use by means of cookies, which are stored on users'' computers. The information generated relating to our website is used to create reports about the use of the website. Google will store this information. Google''s privacy policy is available at: http://www.google.com/privacypolicy.html.]<a href="#_ftn3" name="_ftnref3"><strong>[3]</strong></a></p>\r\n<p>[Our [advertisers / payment services providers] may also send you cookies.]<a href="#_ftn4" name="_ftnref4"><strong>[4]</strong></a></p>\r\n<p>[We publish Google AdSense interest-based advertisements on our website. These are tailored by Google to reflect your interests. To determine your interests, Google will track your behaviour on our website and on other websites across the web using the DART cookie. You can view, delete or add interest categories associated with your browser using Google''s Ads Preference Manager, available at: http://www.google.com/ads/preferences/. You can opt out of the AdSense partner network cookie at: http://www.google.com/privacy/ads/ or by using the NAI''s (Network Advertising Initiative''s) multi-cookie opt-out mechanism at: http://www.networkadvertising.org/managing/opt_out.asp. However, these opt-out mechanisms use cookies, and if you clear the cookies from your browser your opt-out will not be maintained. To ensure that an opt-out is maintained in respect of a particular browser, you should use the Google browser plug-in available at: http://www.google.com/ads/preferences/plugin.]<a href="#_ftn5" name="_ftnref5">[5]</a></p>\r\n<p>&nbsp;</p>\r\n<p>[You can manage your preferences relating to the use of cookies on our website by visiting [<em>URL</em>].]</p>\r\n<h1>&nbsp;</h1>\r\n<p>Most browsers allow you to reject all cookies, whilst some browsers allow you to reject just third party cookies. For example, in Internet Explorer (version 9) you can refuse all cookies by clicking "Tools", "Internet options", "Privacy", and selecting "Block All Cookies" using the sliding selector. Blocking all cookies will, however, have a negative impact upon the usability of many websites[, including this one].]</p>\r\n<p>&nbsp;</p>\r\n<h1>(3)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Using your personal information</h1>\r\n<h1>&nbsp;</h1>\r\n<p>Personal information submitted to us via this website will be used for the purposes specified in this privacy policy or in relevant parts of the website.</p>\r\n<p>&nbsp;</p>\r\n<p>We may use your personal information to:</p>\r\n<p>&nbsp;</p>\r\n<p>[(a)&nbsp;&nbsp;&nbsp; administer the website;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(b)&nbsp;&nbsp;&nbsp; improve your browsing experience by personalising the website;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(c)&nbsp;&nbsp;&nbsp; enable your use of the services available on the website;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(d)&nbsp;&nbsp;&nbsp; send you goods purchased via the website, and supply to you services purchased via the website;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(e)&nbsp;&nbsp;&nbsp; send statements and invoices to you, and collect payments from you;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(f)&nbsp;&nbsp;&nbsp; send you general (non-marketing) commercial communications;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(g)&nbsp;&nbsp;&nbsp; send you email notifications which you have specifically requested;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(h)&nbsp;&nbsp;&nbsp; send you [our newsletter and other] marketing communications relating to our business [or the businesses of carefully-selected third parties] which we think may be of interest to you, by post or, where you have specifically agreed to this, by email or similar technology (and you can inform us at any time if you no longer require marketing communications);]<a href="#_ftn6" name="_ftnref6">[6]</a></p>\r\n<p>&nbsp;</p>\r\n<p>[(i)&nbsp;&nbsp;&nbsp;&nbsp; provide third parties with statistical information about our users &ndash; but this information will not be used to identify any individual user;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(j)&nbsp;&nbsp;&nbsp;&nbsp; deal with enquiries and complaints made by or about you relating to the website;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(k)&nbsp;&nbsp;&nbsp; keep the website secure and prevent fraud;]</p>\r\n<p>&nbsp;</p>\r\n<p>[(l)&nbsp;&nbsp;&nbsp;&nbsp; verify compliance with the terms and conditions governing the use of the website [(including monitoring private messages sent through our website private messaging service)]; and]</p>\r\n<p>&nbsp;</p>\r\n<p>[(m)&nbsp;&nbsp; [<em>other uses</em>].]<a href="#_ftn7" name="_ftnref7">[7]</a></p>\r\n<p>&nbsp;</p>\r\n<p>[Where you submit personal information for publication on our website, we will publish and otherwise use that information in accordance with the licence you grant to us.]<a href="#_ftn8" name="_ftnref8">[8]</a></p>\r\n<p>&nbsp;</p>\r\n<p>[Your privacy settings can be used to limit the publication of your information on the website. You can adjust your privacy settings by [<em>describe how</em>].]</p>\r\n<p>&nbsp;</p>\r\n<p>[We will not, without your express consent, provide your personal information to any third parties for the purpose of direct marketing.]<a href="#_ftn9" name="_ftnref9">[9]</a></p>\r\n<p>&nbsp;</p>\r\n<p>[All our website financial transactions are handled through our payment services provider, [PayPal]. You can review the [PayPal] privacy policy at [www.paypal.com]. We will share information with [PayPal] only to the extent necessary for the purposes of processing payments you make via our website, refunding such payments and dealing with complaints and queries relating to such payments and refunds.]<a href="#_ftn10" name="_ftnref10">[10]</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>(4) &nbsp;&nbsp;&nbsp;&nbsp; Disclosures</strong></p>\r\n<h1>&nbsp;</h1>\r\n<p>We may disclose your personal information to [any of our employees, officers, agents, suppliers or subcontractors] insofar as reasonably necessary for the purposes set out in this privacy policy.</p>\r\n<p>&nbsp;</p>\r\n<p>[We may disclose your personal information to any member of our group of companies (this means our subsidiaries, our ultimate holding company and all its subsidiaries) insofar as reasonably necessary for the purposes set out in this privacy policy.]</p>\r\n<p>&nbsp;</p>\r\n<p>In addition, we may disclose your personal information:</p>\r\n<p>&nbsp;</p>\r\n<p>(a)&nbsp;&nbsp;&nbsp;&nbsp; to the extent that we are required to do so by law;</p>\r\n<p>&nbsp;</p>\r\n<p>(b)&nbsp;&nbsp;&nbsp;&nbsp; in connection with any ongoing or prospective legal proceedings;</p>\r\n<p>&nbsp;</p>\r\n<p>(c)&nbsp;&nbsp;&nbsp;&nbsp; in order to establish, exercise or defend our legal rights (including providing information to others for the purposes of fraud prevention and reducing credit risk);</p>\r\n<p>&nbsp;</p>\r\n<p>[(d)&nbsp;&nbsp;&nbsp; to the purchaser (or prospective purchaser) of any business or asset that we are (or are contemplating) selling; and]</p>\r\n<p>&nbsp;</p>\r\n<p>[(e)&nbsp;&nbsp;&nbsp; to any person who we reasonably believe may apply to a court or other competent authority for disclosure of that personal information where, in our reasonable opinion, such court or authority would be reasonably likely to order disclosure of that personal information.]</p>\r\n<p>&nbsp;</p>\r\n<p>Except as provided in this privacy policy, we will not provide your information to third parties.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>(5)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; International data transfers</strong><a href="#_ftn11" name="_ftnref11">[11]</a></p>\r\n<p>&nbsp;</p>\r\n<p>Information that we collect may be stored and processed in and transferred between any of the countries in which we operate in order to enable us to use the information in accordance with this privacy policy.</p>\r\n<p>&nbsp;</p>\r\n<p>Information which you provide may be transferred to countries [(including [the United States], [Japan], [<em>other countries</em>])] which do not have data protection laws equivalent to those in force in the European Economic Area.</p>\r\n<p>&nbsp;</p>\r\n<p>[In addition, [personal information that you submit for publication on the website] will be published on the internet and may be available, via the internet, around the world. We cannot prevent the use or misuse of such information by others.]</p>\r\n<p>&nbsp;</p>\r\n<p>You expressly agree to such transfers of personal information.</p>\r\n<p>&nbsp;</p>\r\n<h1>(6)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Security of your personal information</h1>\r\n<p>&nbsp;</p>\r\n<p>We will take reasonable technical and organisational precautions to prevent the loss, misuse or alteration of your personal information.</p>\r\n<p>&nbsp;</p>\r\n<p>We will store all the personal information you provide on our secure (password- and firewall-protected) servers.<a href="#_ftn12" name="_ftnref12">[12]</a></p>\r\n<p>&nbsp;</p>\r\n<p>[All electronic transactions entered into via the website will be protected by encryption technology.]</p>\r\n<p>&nbsp;</p>\r\n<p>You acknowledge that the transmission of information over the internet is inherently insecure, and we cannot guarantee the security of data sent over the internet.</p>\r\n<p>&nbsp;</p>\r\n<p>[You are responsible for keeping your password [and other login details] confidential. We will not ask you for your password (except when you log in to the website).]</p>\r\n<p>&nbsp;</p>\r\n<h1>(7)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Policy amendments<a href="#_ftn13" name="_ftnref13">[13]</a></h1>\r\n<p>&nbsp;</p>\r\n<p>We may update this privacy policy from time to time by posting a new version on our website. You should check this page occasionally to ensure you are happy with any changes.</p>\r\n<p>&nbsp;</p>\r\n<p>[We may also notify you of changes to our privacy policy by email.]</p>\r\n<p>&nbsp;</p>\r\n<h1>(8)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Your rights</h1>\r\n<p>&nbsp;</p>\r\n<p>You may instruct us to provide you with any personal information we hold about you. Provision of such information will be subject to:</p>\r\n<p>&nbsp;</p>\r\n<p>(a)&nbsp;&nbsp;&nbsp;&nbsp; the payment of a fee (currently fixed at GBP 10); and</p>\r\n<p>&nbsp;</p>\r\n<p>(b)&nbsp;&nbsp;&nbsp;&nbsp; the supply of appropriate evidence of your identity [(for this purpose, we will usually accept a photocopy of your passport certified by a solicitor or bank plus an original copy of a utility bill showing your current address)].</p>\r\n<p>&nbsp;</p>\r\n<p>We may withhold such personal information to the extent permitted by law.</p>\r\n<p>&nbsp;</p>\r\n<p>You may instruct us not to process your personal information for marketing purposes[, by sending an email to us]. In practice, you will usually either expressly agree in advance to our use of your personal information for marketing purposes, or we will provide you with an opportunity to opt out of the use of your personal information for marketing purposes.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>(9)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Third party websites</strong></p>\r\n<p>&nbsp;</p>\r\n<p>The website contains links to other websites. We are not responsible for the privacy policies or practices of third party websites.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>(10)&nbsp;&nbsp;&nbsp; Updating information</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Please let us know if the personal information which we hold about you needs to be corrected or updated.</p>\r\n<p>&nbsp;</p>\r\n<p>(11) &nbsp;&nbsp; Contact</p>\r\n<p>&nbsp;</p>\r\n<p>If you have any questions about this privacy policy or our treatment of your personal information, please write to us by email to [<em>email</em>] or by post to 3<sup>rd</sup> Floor, 207 Regent Street, London, W1B 3HH, United Kingdom.<a href="#_ftn14" name="_ftnref14">[14]</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>(12)&nbsp;&nbsp;&nbsp; Data controller</strong></p>\r\n<p>&nbsp;</p>\r\n<p>The data controller responsible in respect of the information collected on this website is <em>Five Sessions Ltd.</em></p>\r\n<p>&nbsp;</p>\r\n<p>Our data protection registration number is [<em>number</em>].<a href="#_ftn15" name="_ftnref15">[15]</a></p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref1" name="_ftn1">[1]</a>&nbsp;&nbsp;&nbsp; You should list in this provision all of the different kinds of personal information which will be collected over or in relation to your website. We have suggested a number of common categories.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref2" name="_ftn2">[2]</a>&nbsp;&nbsp;&nbsp; If your site does not use cookies, the paragraphs on cookies can be deleted.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; The rules concerning cookies are set out in Regulation 6 of the Privacy and Electronic Communications (EC Directive) Regulations 2003 (as amended). Regulation 6 provides that:</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp; "<em>(1) Subject to paragraph (4), a person shall not store or gain access to information stored, in the terminal equipment of a subscriber or user unless the requirements of paragraph (2) are met. </em></p>\r\n<p><em>&nbsp;</em></p>\r\n<p><em>&nbsp;&nbsp;&nbsp;&nbsp; (2) The requirements are that the subscriber or user of that terminal equipment&mdash;(a) is provided with clear and comprehensive information about the purposes of the storage of, or access to, that information; and (b) has given his or her consent.</em></p>\r\n<p><em>&nbsp;</em></p>\r\n<p><em>&nbsp;&nbsp;&nbsp;&nbsp; (3) Where an electronic communications network is used by the same person to store or access information in the terminal equipment of a subscriber or user on more than one occasion, it is sufficient for the purposes of this regulation that the requirements of paragraph (2) are met in respect of the initial use.</em></p>\r\n<p><em>&nbsp;</em></p>\r\n<p><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (3A) For the purposes of paragraph (2), consent may be signified by a subscriber who amends or sets controls on the internet browser which the subscriber uses or by using another application or programme to signify consent.</em></p>\r\n<p><em>&nbsp;</em></p>\r\n<p><em>&nbsp;&nbsp;&nbsp;&nbsp; (4) Paragraph (1) shall not apply to the technical storage of, or access to, information&mdash;(a) for the sole purpose of carrying out the transmission of a communication over an electronic communications network; or (b) where such storage or access is strictly necessary for the provision of an information society service requested by the subscriber or user.</em>"</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref3" name="_ftn3">[3]</a>&nbsp;&nbsp;&nbsp; If you do not use Google Analytics, you should check whether your analytics system uses cookies and include an appropriate explanatory paragraph if it does.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref4" name="_ftn4">[4]</a>&nbsp;&nbsp;&nbsp; If so, you should provide details. The following paragraphs give examples.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref5" name="_ftn5">[5]</a>&nbsp;&nbsp;&nbsp; This text should be used if you publish Google AdSense interest-based advertisements on your website. Additional disclosures will be required if you have not opted out of third-party ad serving. For more information, see: https://www.google.com/adsense/support/bin/answer.py?hl=en&amp;answer=100557.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref6" name="_ftn6">[6]</a>&nbsp;&nbsp;&nbsp; As a general rule, where you plan to use personal information you have collected for the purpose of direct marketing, this should be made clear on the page where the information is collected, and you should ensure that this only happens if users opt in to the marketing (eg "Click here if you would like us to send you information by email about products which we think will interest you."). There are, however, exceptions to this general rule. There are also rules about the content of direct marketing communications. If you are in any doubt about complying with your legal obligations in relation to direct marketing, you should seek professional advice.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref7" name="_ftn7">[7]</a>&nbsp;&nbsp;&nbsp; You must list here all the uses to which you will (or may in future) put personal data. Again, we have suggested some common categories.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref8" name="_ftn8">[8]</a>&nbsp;&nbsp;&nbsp; The relevant licence should be set out in the appropriate disclaimer/terms of use/terms of subscription etc document.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref9" name="_ftn9">[9]</a>&nbsp;&nbsp;&nbsp; It is good practice to also say what you will not do with personal information (within reason).</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref10" name="_ftn10">[10]</a>&nbsp;&nbsp; You should insert details of any payment services provider(s) you use here. If you do not collect payments on your website, you can delete this section.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref11" name="_ftn11">[11]</a>&nbsp;&nbsp; Give as much detail as possible about any such international transfers. You also need to be aware that the inclusion of this provision will not be sufficient to ensure that all international transfers of personal data are lawful. If in doubt, you should take professional advice on this point.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref12" name="_ftn12">[12]</a>&nbsp;&nbsp; There is an obligation upon data controllers to store personal data securely. You should provide details of your security measures here.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref13" name="_ftn13">[13]</a>&nbsp;&nbsp; Changes to the policy &ndash; in particular as to permissible uses of personal data &ndash; may not be retrospective. In other words, if you collect personal information on one basis, you cannot, simply by changing the terms of your policy, go on to legitimately use that information on a different basis.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref14" name="_ftn14">[14]</a>&nbsp;&nbsp; You should include a postal address as well as an email address.</p>\r\n<p>&nbsp;</p>\r\n<p><a href="#_ftnref15" name="_ftn15">[15]</a>&nbsp;&nbsp; You should check whether you need to obtain a data protection registration. You can find out about this on the Information Commissioner''s website at http://www.ico.gov.uk.</p>\r\n<p>&nbsp;</p>', NULL, '0000-00-00 00:00:00');
